function Dashboard() {
  const [tab, setTab] = useState("Organisations");

  const staticTabs = ["Profile", "Organisations", "Search"];
  return (
    <div className="Dashboard">
      <section className="tabs">
        <ul className="tabs">
          {staticTabs.map((value, key) => (
            <li
              key={key}
              onClick={() => {
                setTab(value);
              }}
              value={value}
              className={tab === value ? "active" : ""}
            >
              {value}
            </li>
          ))}
        </ul>
      </section>
      <section className="right"></section>
    </div>
  );
}

export default Dashboard;
